import React from "react";
import ReactDOM from "react-dom";
import Add from "./Add";
import {Mult,  Div } from "./Mult";


ReactDOM.render(
    <>
    <ol>
    <li>{Add(3,4)}</li>
     
     <li>{Mult(9,7)}</li>
     <li>{Div(9,3)}</li>
     </ol>
     


    </>,
    document.getElementById("root"));
